import React from 'react';
import Main from './Main';
import Basket from './Basket';
import NavBar from './Navbar';

function Shop({countCartItems, products, onAdd, cartItems, onRemove}) {
  return (
      <div>
        <NavBar />
        <div className="row">
          <Main products={products} onAdd={onAdd}></Main>
          <Basket
            cartItems={cartItems}
            onAdd={onAdd}
            onRemove={onRemove}
          />
        </div>
      </div>
  )
}

export default Shop
